import * as React from 'react'
import { StyleSheet, View, Text, Pressable, Image } from 'react-native'
import { useNavigation } from '@react-navigation/native'
import { Color, FontFamily, Padding, FontSize, Border } from '../GlobalStyles'

const DatosDePago = () => {
  const navigation = useNavigation()

  return (
    <View style={styles.datosDePago}>
      <View style={[styles.pencillineParent, styles.pencillineParentPosition]}>
        <View style={styles.pencilline}>
          <Image
            style={styles.walletIcon}
            contentFit="cover"
            source={require('../assets/wallet.png')}
          />
        </View>
        <View style={styles.frameParent}>
          <View style={styles.datosDePagoWrapper}>
            <Text style={[styles.datosDePago1, styles.imGoingToFlexBox]}>
              Datos de pago
            </Text>
          </View>
          <Text
            style={[styles.imGoingTo, styles.imGoingToFlexBox]}
          >{`Añade o elimina métdos de pago de forma segura para agilizar el proceso de inscripción

`}</Text>
        </View>
      </View>
      <View style={styles.gestionaTuCuentaWrapper}>
        <Text
          style={[styles.gestionaTuCuentaContainer, styles.imGoingToFlexBox]}
        >
          {`GESTIONA TU `}CUENTA
        </Text>
      </View>
      <View style={[styles.datosDePagoInner, styles.pencillineParentPosition]}>
        <View style={styles.datosDePagoContainer}>
          <Text style={[styles.datosDePago2, styles.datosTypo]}>
            Datos de pago
          </Text>
        </View>
      </View>
      <Pressable
        style={styles.aadirTarjetaWrapper}
        onPress={() => navigation.navigate('Metodo')}
      >
        <Text style={[styles.aadirTarjeta, styles.datosTypo]}>
          Añadir tarjeta
        </Text>
      </Pressable>
      <View style={[styles.menInferior, styles.menInferiorLayout]}>
        <View style={[styles.groupParent, styles.menInferiorLayout]}>
          <Pressable
            style={styles.wrapper}
            onPress={() => navigation.navigate('UltimasConsultas')}
          >
            <Image
              style={styles.icon}
              contentFit="cover"
              source={require('../assets/group-1171276700.png')}
            />
          </Pressable>
          <Pressable
            style={[styles.vector, styles.frameLayout]}
            onPress={() => navigation.navigate('Favoritos1')}
          >
            <Image
              style={styles.icon}
              contentFit="cover"
              source={require('../assets/vector1.png')}
            />
          </Pressable>
          <Image
            style={styles.capturaDePantalla20231124}
            contentFit="cover"
            source={require('../assets/captura-de-pantalla-20231124-114115-1.png')}
          />
          <Pressable
            style={[styles.container, styles.frameLayout]}
            onPress={() => navigation.navigate('HistorialDePruebas')}
          >
            <Image
              style={styles.icon}
              contentFit="cover"
              source={require('../assets/frame-1547756022.png')}
            />
          </Pressable>
          <Pressable
            style={[styles.frame, styles.frameLayout]}
            onPress={() => navigation.navigate('TuPerfil')}
          >
            <Image
              style={styles.icon}
              contentFit="cover"
              source={require('../assets/group-1171276701.png')}
            />
          </Pressable>
        </View>
        <Image
          style={styles.menInferiorChild}
          contentFit="cover"
          source={require('../assets/ellipse-7194.png')}
        />
      </View>
    </View>
  )
}

const styles = StyleSheet.create({
  pencillineParentPosition: {
    width: 320,
    left: 20,
    position: 'absolute'
  },
  imGoingToFlexBox: {
    color: Color.sportsVioleta,
    textAlign: 'left',
    alignSelf: 'stretch'
  },
