    shadowColor: 'rgba(0, 0, 0, 0.25)',
    shadowOffset: {
      width: 2,
      height: 2
    },
    shadowRadius: 4,
    elevation: 4,
    shadowOpacity: 1,
    borderStyle: 'solid',
    borderColor: Color.colorGainsboro_100,
    borderWidth: 1,
    height: 148,
    flexDirection: 'row'
  },
  gestionaTuCuentaContainer: {
    fontSize: FontSize.size_5xl,
    textAlign: 'left',
    fontFamily: FontFamily.interBold,
    fontWeight: '700'
  },
  gestionaTuCuentaWrapper: {
    top: 67,
    left: 20,
    position: 'absolute'
  },
  datosDePago2: {
    color: Color.sportsNaranja,
    textAlign: 'left',
    fontSize: FontSize.size_sm,
    fontWeight: '700'
  },
  datosDePagoContainer: {
    alignItems: 'center',
    flexDirection: 'row'
  },
  datosDePagoInner: {
