  },
  container: {
    width: 20,
    marginLeft: 47
  },
  frame: {
    width: 19,
    marginLeft: 47
  },
  groupParent: {
    top: 10,
    left: 0,
    backgroundColor: Color.gris,
    height: 65,
    paddingHorizontal: Padding.p_xl,
    paddingVertical: Padding.p_3xs,
    justifyContent: 'center',
    alignItems: 'center',
    flexDirection: 'row'
  },
  menInferiorChild: {
    top: 0,
    left: 165,
    width: 37,
    height: 24,
    position: 'absolute'
  },
  menInferior: {
    marginLeft: -180,
    bottom: 0,
    left: '50%',
    height: 75
  },
  datosDePago: {
    backgroundColor: Color.blanco,
    height: 800,
    overflow: 'hidden',
